  false,\n\t\"url\": null,\n\t\"notes\": \"Because lesser number of ducks were expected
  to come South in the fall of 1961, shooting regulations were restricted to reduce
  the kill. Surveyed revealed that regulations reduced duck kill in the United States
  from 9.6 million in 1960-1961 to 63 million in 1961-1962. Nonetheless, the breeding
  duck population index was reduced by 3.5 million birds compared to 1961. The duck
  population was overharvested in fall 1962.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
